import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './screens/LoginScreen';
import RegisterScreen from './screens/RegisterScreen';
import HomePage1 from './screens/HomePage1'
import HelpPage from './screens/HelpPage';
import HomePage2 from './screens/HomePage2';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Login" >
        <Stack.Screen name="Login" component={LoginScreen} options={{ headerShown: false}}/>
        <Stack.Screen name="Register" component={RegisterScreen} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
        <Stack.Screen name="HomePage1"  component={HomePage1} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
        <Stack.Screen name="HelpPage"  component={HelpPage} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
          <Stack.Screen name="HomePage2"  component={HomePage2} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>

      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
